import { create, createOptions, RichEdit } from 'devexpress-richedit';
import { useEffect } from 'react';
import 'devextreme/dist/css/dx.common.css'
import 'devextreme/dist/css/dx.light.css'
import 'devexpress-richedit/dist/dx.richedit.css'

const documentFormat = {
  PlainText: 1,
  Rtf: 2,
  OpenXml: 4
}
let countNumber = 1
function App() {
  useEffect(() => {

    if(countNumber !== 1) return
    countNumber++;

    const options = createOptions();
      let rich = create(document.getElementById('richEdit'), options);
     
      // document protected is fail
      const documentProtectedBase64 = "data:application/vnd.openxmlformats-officedocument.wordprocessingml.document;base64,"
      rich.openDocument(documentProtectedBase64, 'testEncrypted', documentFormat.OpenXml)

      // // document unprotected is successffuly
      // const documentBase64 = "data:application/vnd.openxmlformats-officedocument.wordprocessingml.document;base64,"
      // rich.openDocument(documentBase64, 'testbug_169180', documentFormat.OpenXml)
  }, [])
  
  return <div id="richEdit"></div>;
}

export default App;
